import gym

env=gym.make('CartPole-v0')

env.action_space

env.observation_space

env.action_space.sample()

env.observation_space.sample()

env.reset()

env.step(env.action_space.sample())

"""The observation of this environment is four floating-point numbers
containing information about the **x coordinate of the stick's centre of mass, its speed, its angle to the platform, and its angular speed **. Of course, by applying some math and physics knowledge, it will not be complicated to convert these numbers into actions when we need to balance the stick, but our problem is this â€“ how do we learn to
balance this system without knowing the exact meaning of the
observed numbers and only by getting the reward? The reward in
this environment is 1, and it is given on every time step. The episode
continues until the stick falls, so to get a more accumulated reward,
we need to balance the platform in a way to avoid the stick falling.
"""

total_reward=0
total_steps=0
env.reset()

while True:

  action = env.action_space.sample()
  obs, reward, done, _ = env.step(action)
  total_reward += reward
  total_steps += 1
  if done:
    break
print("Episode done in %d steps, total reward %.2f" % (
        total_steps, total_reward))

"""###WRAPPER###

To make it slightly more practical, let's imagine a situation where we
want to intervene in the stream of actions sent by the agent and, with
a probability of 10%, replace the current action with a random one. It
might look like an unwise thing to do, but this simple trick is one of
the most practical and powerful methods for solving the
***exploration/exploitation problem***.

By issuing the random actions, we
make our agent explore the environment and from time to time drift
away from the beaten track of its policy. 
This is an easy thing to do
using the ***ActionWrapper*** class![RL2.gif](data:image/gif;base64,)
"""

import gym
from typing import TypeVar
import random

Action = TypeVar('Action')


class RandomActionWrapper(gym.ActionWrapper):
    def __init__(self, env, epsilon=0.1):
        super(RandomActionWrapper, self).__init__(env)    # we initialized our wrapper by calling a parent's __init__method
        self.epsilon = epsilon                            # saving epsilon (the probability of a random action).

    def action(self, action: Action) -> Action:           # method that we need to override from a parent's class to tweak the agent's actions
        if random.random() < self.epsilon:                # Every time we roll the die, and with the
                                                          # probability of epsilon, we sample a random action from the action
                                                          # space and return it instead of the action the agent has sent to us.
            
            print("Random!")
            return self.env.action_space.sample()
        return action


if __name__ == "__main__":
    env = RandomActionWrapper(gym.make("CartPole-v0"))

    obs = env.reset()
    total_reward = 0.0

    while True:
        obs, reward, done, _ = env.step(0)
        total_reward += reward
        if done:
            break

    print("Reward got: %.2f" % total_reward)

